import { useState } from 'react';

const Country = () => {
    const [country, setCountry] = useState([
        {
            Ottawa: 'Canada',
        },
        {
            Belgrade: 'Serbia'
        },
        {
            Stockholm: 'Sweden'
        },
        {
            Vienna: 'Austria'
        },
    ])


    return (
        <>
            <p id="country"></p>
        </>
    )
}
export default Country;
